import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Math Operations</h1>
        <p>Choose an operation to perform:</p>
        <div>
          <ul>
            <li>
              <Link to="/addition">Penjumlahan</Link>
            </li>
            <li>
              <Link to="/subtraction">Pengurangan</Link>
            </li>
            <li>
              <Link to="/multiplication">Perkalian</Link>
            </li>
            <li>
              <Link to="/division">Pembagian</Link>
            </li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default App;
